import React, { useState, useEffect } from "react";
import "./VideoPlayer.css";
import ThumbUpOffAltIcon from "@mui/icons-material/ThumbUpOffAlt";
import ThumbDownOffAltIcon from "@mui/icons-material/ThumbDownOffAlt";
import ReplyIcon from "@mui/icons-material/Reply";
import ArrowDownwardIcon from "@mui/icons-material/ArrowDownward";
import KeyboardArrowDownIcon from "@mui/icons-material/KeyboardArrowDown";
// import React,{useState,useEffect} from "react";
import "./Video.css";
import { Avatar } from "@mui/material";
import { Link } from "react-router-dom";
export default function Video({ e,VData,VideoData }) 


 {
  let [ChannelAvatar,SetChannelAvatar] = useState("")
  useEffect(()=>{
    fetch(
      `https://youtube.googleapis.com/youtube/v3/channels?part=Snippet&id=${e.snippet.channelId}&key=AIzaSyDDE2thMx3nbsAmxnr1fueEHEj7QNjOM_s`
    )
    .then((res)=>
    {
return res.json()
      })  .then((Data)=>
      {
 console.log(Data)
SetChannelAvatar(Data.items[0].snippet.thumbnails.high.url)
        })
    
   },[])
  let [Comments, SetComments] = useState([]);
  useEffect(() => {
    // fetch(
    //   ` https://www.googleapis.com/youtube/v3/commentThreads?key=AIzaSyBE24lPSvzaJ-HYyDXqvn-To_FEjrsv590&textFormat=plainText&part=snippet&videoId=${VideoData.id.videoId}&maxResults=100`
    // )
    fetch(
      ` https://www.googleapis.com/youtube/v3/commentThreads?key=AIzaSyDDE2thMx3nbsAmxnr1fueEHEj7QNjOM_s&textFormat=plainText&part=snippet&videoId=${VideoData.id.videoId}&maxResults=100`
    )
      .then((res) => {
        return res.json();
      })
      .then((Data) => {
        console.log(Data);
        SetComments(Data.items);
      });
  }, []);

  return (
    <><Link to={"VideoPlayer"}>
    <div id="VideoCard" onClick={()=>{
      console.log(e)
      VData(e)
    }
    }>
      <img src={e.snippet.thumbnails.high.url} alt="" id="Thumbnail" />

      <div id="VideoInfo">
        <Avatar src={ChannelAvatar}/>

        <div id="VideoText">
          <h2>{e.snippet.title}</h2>
          <p>{e.snippet.channelTitle}</p>
          <p>{"2 Million Views . 2 days"}</p>
        </div>
      </div>

    </div>
    </Link>
  
      <div>
        <center>
          <iframe
            id="Videoiframe"
            width="560"
            height="315"
            src={`https://www.youtube.com/embed/${VideoData.id.videoId}`}
            title="YouTube video player"
            frameborder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowfullscreen
          ></iframe>
        </center>
        <div id="IconInVideo">
          <ThumbUpOffAltIcon id="ThumbUpOffAltIcon" />
          <ThumbDownOffAltIcon id="ThumbDownOffAltIcon" />

          <button id="ReplyIcon">
            Share
            <ReplyIcon />
          </button>
          <button id="ArrowDownwardIconD">
            <ArrowDownwardIcon />
            Download
          </button>

          <button id="Subcribe">Subcribe</button>
        </div>
      </div>
      <hr />

      <div class="dropdown">
        <button class="dropbtn">
          Comments
          <KeyboardArrowDownIcon />
        </button>
        <div class="dropdown-content">
          {Comments.map((C) => (
            <p>
              {C.snippet.topLevelComment.snippet.textOriginal} <br />
              <br/>
              <ThumbUpOffAltIcon id="CommentIcons" />
              <ThumbDownOffAltIcon id="CommentIcons2" /> <h9>Replay</h9> <hr />
            </p>
          ))}
        </div>
      </div>
      

 

    </>
  );
}
